import React from 'react';
import {BrowserRouter as Router,Switch,Route,} from "react-router-dom";
import api from "../src/server_api/api"


class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            city_list: "",
        }
    }

    async componentDidMount() {
        const data = await api.getCitiesName();
        this.setState({
            city_list: data.data
        });
        console.log(this.state.city_list)
    }

    render() {
        return (
            <div>

                <Router>


                    <Switch>
                        <Route path={"/MySpace"}>
                            <MySpace/>
                        </Route>

                        <Route path="/">
                            <HomePage/>
                        </Route>

                    </Switch>

                </Router>
            </div>
        );
    }
}
export default App;
